import React, { useState } from "react";

function App() {
  const [contact, setContact] = useState({
    fName: "",
    lName: "",
    email: "",
  });
  const [hoverChange, setHovercolor] = useState(false);

  function handleChange(event) {
    const { value, name } = event.target;

    setContact((prevValue) => ({
      ...prevValue,
      [name]: value,
    }));
  }

  function Mousehover() {
    setHovercolor(true);}

    function MouseOut() {
      setHovercolor(false);
    }

  return (
    <div className="container">
      <h1>
        Hello {contact.fName} {contact.lName} <br />
        <span className="Greeting">Welcome to Feyverly Service </span>
      </h1>
      <p>{contact.email}</p>
      <form>
        <input
          onChange={handleChange}
          name="username"
          placeholder="username"
          value={contact.fName}
        />
        <input
          onChange={handleChange}
          name="passwords"
          placeholder="passwords"
          value={contact.lName}
        />
        <input
          type="email"
          onChange={handleChange}
          name="email"
          placeholder="Email"
          value={contact.email}
        />
        <button style={{ backgroundColor: hoverChange ? "black" : "white" }}
          onMouseOver={Mousehover}
          onMouseOut={MouseOut}>REGISTER</button>
      </form>
    </div>
  );
}

export default App;
